  l_clob t_clob;
  type   t_varchar2 is table of varchar2(64) index by binary_integer;
  l_varchar2 t_varchar2;
begin

  l_varchar2(1) :=q'!44353!';
  l_varchar2(2) :=q'!147053510611055550070873595671355348250!';
  l_clob(3) :=q'!JOANNE.MCHENRY@MIDDLEMORE.CO.NZ!';
  l_varchar2(4) :=q'!09.07.2018 03:07:21.247688000 +00:00!';
  l_clob(5) :=q'!4307090239610!';

  insert into ASSETS.EBA_PROJ_STATUS_CLICKS
  (
     ID
    ,PROJECT_ID
    ,APP_USERNAME
    ,VIEW_TIMESTAMP
    ,APP_SESSION
  )
