  l_clob t_clob;
  type   t_varchar2 is table of varchar2(64) index by binary_integer;
  l_varchar2 t_varchar2;
begin

  l_varchar2(1) :=q'!42544!';
  l_varchar2(2) :=q'!143100884773698319569041838381778887892!';
  l_clob(3) :=q'!JUDE.HARRIS@MIDDLEMORE.CO.NZ!';
  l_varchar2(4) :=q'!27.06.2018 21:54:49.136265000 +00:00!';
  l_clob(5) :=q'!17210522002816!';

  insert into ASSETS.EBA_PROJ_STATUS_CLICKS
  (
     ID
    ,PROJECT_ID
    ,APP_USERNAME
