  l_clob t_clob;
  type   t_varchar2 is table of varchar2(64) index by binary_integer;
  l_varchar2 t_varchar2;
begin

  l_varchar2(1) :=q'!25781!';
  l_varchar2(2) :=q'!130656708361971577967812401453991787573!';
  l_clob(3) :=q'!JUDE.HARRIS@MIDDLEMORE.CO.NZ!';
  l_varchar2(4) :=q'!16.04.2018 20:16:17.583079000 +00:00!';
  l_clob(5) :=q'!114790560144809!';

  insert into ASSETS.EBA_PROJ_STATUS_CLICKS
  (
     ID
    ,PROJECT_ID
    ,APP_USERNAME
