  l_clob t_clob;
  type   t_varchar2 is table of varchar2(64) index by binary_integer;
  l_varchar2 t_varchar2;
begin

  l_varchar2(1) :=q'!35682!';
  l_varchar2(2) :=q'!140791532192937435867036084506402235628!';
  l_clob(3) :=q'!JOANNE.MCHENRY@MIDDLEMORE.CO.NZ!';
  l_varchar2(4) :=q'!28.05.2018 02:15:59.521580000 +00:00!';
  l_clob(5) :=q'!112992723953203!';

  insert into ASSETS.EBA_PROJ_STATUS_CLICKS
  (
     ID
    ,PROJECT_ID
    ,APP_USERNAME
    ,VIEW_TIMESTAMP
    ,APP_SESSION
  )
